import React from "react";
import './style.css';
import './style1.css';
import Cities from './cities.json'

function Ul() {
    console.log(Cities.length);
    return(
        <div>
            for()
            <ul id="pagintion-ul">
                <li id="pagintion-li">1</li>
                <li id="pagintion-li">2</li>
            </ul>
        </div>
    )
    
}

export default Ul;
